import React from "react";
import "./styles.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

export function Header() {
  return (
    <div className="header">
      <h2 className="header__name">Shortly</h2>

      <nav className="header__navbar">
        <div
          className="header__navbar__menu"
          onClick={() => {
            const navs = document.querySelectorAll(".Navbar__Items");

            navs.forEach(nav => nav.classList.toggle("Navbar__ToggleShow"));
          }}
        >
          <FontAwesomeIcon icon={faBars} />
        </div>
        <p className="header__navbar__link">Features</p>
        <p className="header__navbar__link">Pricing</p>
        <p className="header__navbar__link">Ressources</p>
        <p className="header__navbar__link--right">Login</p>
        <button className="header__navbar__signup">Sign Up</button>
      </nav>
    </div>
  );
}
